import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../styles/MedicalDocuments.css';

const MedicalDocuments = () => {
  const { currentUser, isAuthenticated, loading } = useAuth();
  const navigate = useNavigate();
  const [documents, setDocuments] = useState([]);
  const [isUploading, setIsUploading] = useState(false);
  const [uploadSuccess, setUploadSuccess] = useState(false);
  const [uploadError, setUploadError] = useState('');
  const [selectedFile, setSelectedFile] = useState(null);
  const [documentType, setDocumentType] = useState('');
  const [documentName, setDocumentName] = useState('');

  useEffect(() => {
    if (!loading && !isAuthenticated) {
      navigate('/login');
      return;
    }

    if (!loading && currentUser && currentUser.role !== 'patient') {
      navigate('/');
      return;
    }

    if (isAuthenticated && currentUser) {
      // Fetch user documents
      fetchUserDocuments();
    }
  }, [loading, isAuthenticated, currentUser, navigate]);

  const fetchUserDocuments = async () => {
    try {
      // In a real application, this would be an API call to fetch documents
      // For now, we'll use mock data
      const mockDocuments = [
        {
          id: '1',
          name: 'Blood Test Results',
          type: 'Lab Report',
          uploadDate: '2023-05-15',
          fileUrl: '#',
          thumbnailUrl: 'https://via.placeholder.com/100'
        },
        {
          id: '2',
          name: 'COVID-19 Vaccination Card',
          type: 'Vaccination Record',
          uploadDate: '2023-02-10',
          fileUrl: '#',
          thumbnailUrl: 'https://via.placeholder.com/100'
        },
        {
          id: '3',
          name: 'X-Ray Report',
          type: 'Radiology',
          uploadDate: '2023-04-20',
          fileUrl: '#',
          thumbnailUrl: 'https://via.placeholder.com/100'
        }
      ];
      
      setDocuments(mockDocuments);
    } catch (error) {
      console.error('Error fetching documents:', error);
    }
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setSelectedFile(file);
      if (!documentName) {
        setDocumentName(file.name.split('.')[0]);
      }
    }
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    
    if (!selectedFile || !documentType || !documentName) {
      setUploadError('Please fill in all fields and select a file.');
      return;
    }

    setIsUploading(true);
    setUploadError('');
    
    try {
      // In a real application, this would be an API call to upload the document
      // For demonstration, we'll simulate a delay and success
      await new Promise(resolve => setTimeout(resolve, 1500));
      
      const newDocument = {
        id: Date.now().toString(),
        name: documentName,
        type: documentType,
        uploadDate: new Date().toISOString().split('T')[0],
        fileUrl: '#',
        thumbnailUrl: 'https://via.placeholder.com/100'
      };
      
      setDocuments([newDocument, ...documents]);
      setUploadSuccess(true);
      
      // Reset form
      setSelectedFile(null);
      setDocumentType('');
      setDocumentName('');
      
      // Clear success message after 3 seconds
      setTimeout(() => {
        setUploadSuccess(false);
      }, 3000);
    } catch (error) {
      console.error('Error uploading document:', error);
      setUploadError('Failed to upload document. Please try again.');
    } finally {
      setIsUploading(false);
    }
  };

  const handleDelete = (documentId) => {
    if (window.confirm('Are you sure you want to delete this document?')) {
      setDocuments(documents.filter(doc => doc.id !== documentId));
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-spinner">
          <div className="spinner"></div>
          <p>Loading...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="medical-documents-page">
      <div className="container">
        <div className="page-header">
          <button className="back-button" onClick={() => navigate('/patient-dashboard')}>
            &larr; Back to Dashboard
          </button>
          <h1>Medical Documents</h1>
        </div>

        <div className="documents-grid">
          <div className="upload-section">
            <h2>Upload New Document</h2>
            <form onSubmit={handleUpload} className="upload-form">
              <div className="form-group">
                <label htmlFor="documentName">Document Name</label>
                <input
                  type="text"
                  id="documentName"
                  value={documentName}
                  onChange={(e) => setDocumentName(e.target.value)}
                  placeholder="Enter document name"
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="documentType">Document Type</label>
                <select
                  id="documentType"
                  value={documentType}
                  onChange={(e) => setDocumentType(e.target.value)}
                >
                  <option value="">Select document type</option>
                  <option value="Lab Report">Lab Report</option>
                  <option value="Prescription">Prescription</option>
                  <option value="Radiology">Radiology</option>
                  <option value="Vaccination Record">Vaccination Record</option>
                  <option value="Insurance">Insurance</option>
                  <option value="Other">Other</option>
                </select>
              </div>
              
              <div className="form-group">
                <label htmlFor="documentFile">Select File</label>
                <input
                  type="file"
                  id="documentFile"
                  onChange={handleFileChange}
                  accept=".pdf,.jpg,.jpeg,.png,.doc,.docx"
                />
                {selectedFile && (
                  <p className="selected-file">
                    Selected: {selectedFile.name} ({Math.round(selectedFile.size / 1024)} KB)
                  </p>
                )}
              </div>
              
              {uploadError && <div className="error-message">{uploadError}</div>}
              {uploadSuccess && <div className="success-message">Document uploaded successfully!</div>}
              
              <button 
                type="submit" 
                className="upload-button" 
                disabled={isUploading || !selectedFile}
              >
                {isUploading ? 'Uploading...' : 'Upload Document'}
              </button>
            </form>
          </div>

          <div className="documents-list">
            <h2>Your Documents</h2>
            {documents.length === 0 ? (
              <p className="no-documents">You haven't uploaded any documents yet.</p>
            ) : (
              <div className="documents-container">
                {documents.map(doc => (
                  <div key={doc.id} className="document-card">
                    <div className="document-thumbnail">
                      <img src={doc.thumbnailUrl} alt={doc.name} />
                    </div>
                    <div className="document-info">
                      <h3>{doc.name}</h3>
                      <p><strong>Type:</strong> {doc.type}</p>
                      <p><strong>Uploaded:</strong> {doc.uploadDate}</p>
                      <div className="document-actions">
                        <button className="view-button" onClick={() => window.open(doc.fileUrl, '_blank')}>
                          View
                        </button>
                        <button className="delete-button" onClick={() => handleDelete(doc.id)}>
                          Delete
                        </button>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default MedicalDocuments;
